import React, {useState} from 'react';
import './App.css';
import {SuperCounter} from "./SuperCounter";
import {MaxMInValue} from "./MaxMInValue";


function App() {



    const [maxValue,SetMax]=useState(5)
    const [minValue,SetMin]=useState(0)


    const Inc = () => {
        SetMin(prevState => prevState + 1)
    }

    const Reset = () => {
        SetMin(0)
    }

    const Set = (Max: number, Min: number) => {
        SetMin(Min)
        SetMax(Max)
    }
    const MaxValue =(e:number)=> {
        SetMax(e)
    }

    const MinValue =(e:number)=> {
        SetMin(e)
    }


    return (
        <div className="App">

            <MaxMInValue set={Set} MaxValue={MaxValue} MinValue={MinValue}/>
            <SuperCounter inc={Inc} value={minValue} reset={Reset} disable={maxValue} MaxValue={maxValue} MinValue={minValue}/>

        </div>
    );
}

export default App;
